import { Button, Card, CardContent, Divider, FormControl, FormLabel, InputLabel, Stack, TextField, Typography } from '@mui/material';
import React, {useState} from 'react';
import { useNavigate } from 'react-router-dom';
import '../css/volunteerlogin.css'; 

export default function VolunteerLogin(){
    const demoEmail = 'abc@gmail.com'
    const demoPassword = 'abc'
    const [error, setError] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const navigate = useNavigate();

    const handleVolRegister = (event) => {
        navigate('/volregister')
    }

    const handleAdminRegister = (event) => {
        navigate('/adminregister')
    }

    const handleAdminLogin = (event) => {
        navigate('/adminlogin')
    }

    const handleSubmit = (event) => {
        event.preventDefault();
        if(email === demoEmail && password === demoPassword){
            setError('');
            navigate('/volhome');
        }
        else{
            setError(true)
        }
    }
    return(
        <div className="centered-container" style={{backgroundColor: '#CCCCFF', display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh', textAlign: 'center'}}>
            <Card style={{ width: '800px' , height: '500px', border: '1px solid black'}}>
                <CardContent>
                    <h1>Volunteer Login</h1>
                    <Divider style={{ margin: '16px 0', backgroundColor: 'black'}}/>
                    <br />
                    <br />
                    <FormControl>
                        <Stack spacing={2} direction="row" sx={{marginBottom: 4}}>
                            <TextField id="email" label="Email" variant="outlined" fullWidth required onChange={e => setEmail(e.target.value)} error={error}/>
                            <TextField id="password" label="Password" type="password" variant="outlined" fullWidth required onChange={e => setPassword(e.target.value)} error={error}/>
                        </Stack>
                        <br />
                        <Button variant="contained" style={{backgroundColor: '#CCCCFF', color: 'black', border: '1px solid black'}} fullWidth type="submit" onClick={handleSubmit}>Volunteer Login</Button>
                        <br />
                        <Button variant="contained" style={{backgroundColor: '#CCCCFF', color: 'black', border: '1px solid black'}} fullWidth type="submit" onClick={handleVolRegister}>Volunteer Registration</Button>
                        <br />
                        <Button variant="contained" style={{backgroundColor: '#CCCCFF', color: 'black', border: '1px solid black'}} fullWidth type="submit" onClick={handleAdminRegister}>Admin Registration</Button>
                        <br />
                        <Button variant="contained" style={{backgroundColor: '#CCCCFF', color: 'black', border: '1px solid black'}} fullWidth type="submit" onClick={handleAdminLogin}>Admin Login</Button>
                    </FormControl>
                </CardContent>
            </Card>
        </div>
